pragma solidity ^0.8.17;

import "../token/IDXBL.sol";
import "./oracles/IArbitrumGasOracle.sol";
import "../vault/interfaces/ICommunityVault.sol";
import "./oracles/IStandardGasAdjustments.sol";

library DexibleStorage {
    bytes32 constant DEXIBLE_STORAGE_KEY = 0x949817a987a8e038ef345d3c9d4fd28e49d8e4e09456e57c05a8b2ce2e62866c;

    //primary initialization config settings
    struct DexibleConfig {

        //percent to split to revshare
        uint8 revshareSplitRatio;

        //std bps rate to apply to all trades
        uint16 stdBpsRate;

        //minimum bps rate regardless of tokens held
        uint16 minBpsRate;

        //multi sig allowed to change settings
        address adminMultiSig;

        //the vault contract
        address communityVault;

        //treasury for Dexible team
        address treasury;

        //the DXBL token address
        address dxblToken;

        //arbitrum gas oracle contract address
        address arbGasOracle;

        //contract that manages the standard gas adjustment types
        address stdGasAdjustment;

        //minimum flat fee to charge if bps fee is too low
        uint112 minFeeUSD;

        //whitelisted relays to allow
        address[] initialRelays;

    }

    /**
     * This is the primary storage for Dexible operations.
     */
    struct DexibleData {

        //whether contract has been paused
        bool paused;

        //how much of fee goes to revshare vault
        uint8 revshareSplitRatio;

        //standard bps fee rate
        uint16 stdBpsRate;

        //minimum fee applied regardless of tokens held
        uint16 minBpsRate;

        //min fee to charge if bps too low
        uint112 minFeeUSD;

        //vault address
        ICommunityVault communityVault;

        //treasury address
        address treasury;

        //multi-sig that manages this contract
        address adminMultiSig;

        //the DXBL token
        IDXBL dxblToken;

        //gas oracle for arb network
        IArbitrumGasOracle arbitrumGasOracle;

        IStandardGasAdjustments stdGasAdjustment;

        //whitelisted relay wallets
        mapping(address => bool) relays;
    }

    function load() internal pure returns (DexibleData storage ds) {
        assembly { ds.slot := DEXIBLE_STORAGE_KEY }
    }
}","keccak256":"0xf9afdbd57c2ed084edb6ab3f51c9816a1d0f1b4150efde31a630b1f795d55c1e","license":"Unlicense"},"src/dexible/LibFees.sol":{"content":"//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.17;

import "./oracles/IOptimismGasOracle.sol";
import "./DexibleStorage.sol";
import "../common/LibConstants.sol";
import "./oracles/IStandardGasAdjustments.sol";
import "hardhat/console.sol";

library LibFees {

    //special handling for L2s that impose an L1 rollup fee
    uint constant ARB = 42161;
    uint constant OPT = 10;
    IOptimismGasOracle constant optGasOracle = IOptimismGasOracle(0x420000000000000000000000000000000000000F);

    function computeGasCost(uint gasUsed, bool success) internal view returns(uint) {
        DexibleStorage.DexibleData storage ds = DexibleStorage.load();
        uint add = ds.stdGasAdjustment.adjustment(success ? LibConstants.SWAP_SUCCESS : LibConstants.SWAP_FAILURE);
        gasUsed += add;
        //console.log("Gas used to compute cost in fee token", gasUsed, "after adding", add);
        uint cid;
        assembly {
            cid := chainid()
        }
        if(cid == ARB) {
            return ds.arbitrumGasOracle.calculateGasCost(msg.data.length, gasUsed);
        }
        if(cid == OPT) {
            return (tx.gasprice * gasUsed) + optGasOracle.getL1Fee(msg.data);
        }
       // console.log("Gas fee", tx.gasprice * gasUsed);
        return tx.gasprice * gasUsed;
    }

    function computeMinFeeUnits(address feeToken) internal view returns (uint) {
        DexibleStorage.DexibleData storage rs = DexibleStorage.load();
        if(rs.minFeeUSD == 0) {
            return 0;
        }

        //fee token price is in 30-dec units.
        uint usdPrice = rs.communityVault.feeTokenPriceUSD(feeToken);

        uint8 ftDecs = IERC20Metadata(feeToken).decimals();

        //fee USD configuration is expressed in 18-decimals. Have to convert to fee-token units and 
        //account for price units
        uint minFeeUSD = (rs.minFeeUSD * (ftDecs != 18 ? ((10**ftDecs) / 1e18) : 1)) * LibConstants.PRICE_PRECISION;

        //then simply divide to get fee token units that equate to min fee USD
        return  minFeeUSD / usdPrice;
    }
}","keccak256":"0x4c616342a267f09800640a8daa19d8efeb679f8e7d95ace50820c4233e1414db","license":"Unlicense"},"src/dexible/oracles/IArbitrumGasOracle.sol":{"content":"//SPDX-License-Identifier: Unlicense
